const back_arrow = require('../assets/icons/back_arrow_icon.png');
const filter = require('../assets/icons/filter_icon.png');
const gift = require('../assets/icons/gift_icon.png');
const like = require('../assets/icons/like_icon.png');
const search = require('../assets/icons/search_icon.png');
const share = require('../assets/icons/share_icon.png');
const buy_ticket = require('../assets/icons/buy_ticket_icon.png');
const tab_1 = require('../assets/icons/tab_1_icon.png');
const tab_2 = require('../assets/icons/tab_2_icon.png');
const tab_3 = require('../assets/icons/tab_3_icon.png');
const tab_4 = require('../assets/icons/tab_4_icon.png');

export default {
  back_arrow,
  filter,
  gift,
  like,
  search,
  share,
  buy_ticket,
  tab_1,
  tab_2,
  tab_3,
  tab_4,
};
